import { style } from "typestyle";


const HomeMembershipSeccionStyle = style({
    display: 'flex',
    height: '90vh',
    width: '100%',
    $nest: {
        '& .title_seccion': {
            position: 'relative',
            paddingLeft: '120px',
            margin: 'auto',
            width: '50%',
            $nest: {
                '& h1': {
                    fontFamily: 'CocoGothSemiBold',
                    lineHeight: 1,
                    fontSize: '95px',
                    textTransform: 'uppercase'
                },
                '& .ray': {
                    position: "absolute",
                    top: 70,
                    right: 160
                }
            }
        },
        '& .info_seccion': {
            position: 'relative',
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'center',
            backgroundColor: '#00CFBE',
            padding: 0,
            paddingLeft: '200px',
            $nest: {
                '& .info_title': {
                    fontFamily: 'CocoGothLight',
                    fontSize: '24px',
                    color: 'white',
                    $nest: {
                        '& span': {
                            fontFamily: 'CocoGothSemiBold',
                            fontSize: '60px',
                            lineHeight: 1
                        }
                    }
                },
                '& .info_subtitle': {
                    fontFamily: 'CocoGothSemiBold',
                    fontSize: '24px',
                    color: 'white',
                    lineHeight: 1.1,
                    $nest: {
                        '& span': {
                            color: '#202230'
                        },
                    }

                },
                '& ul': {
                    // fontFamily: 'CocoGothSemiBold',
                    margin: 0,
                    marginLeft: 20,
                    padding: 0,
                    $nest: {
                        '& li': {
                            maxWidth: '380px',
                            fontSize: '17px',
                            lineHeight: '27px',
                        }
                    }
                },
                '& .center_image': {
                    position: 'absolute',
                    left: -120,

                    borderRadius: '50%'
                },
                '& .membership_button': {
                    position: 'absolute',
                    backgroundColor: '#202230',
                    fontFamily: 'CocoGothLight',
                    fontSize: '20px',
                    padding: '20px 60px',
                    margin: 0,
                    transform: 'rotate(-90deg)',
                    right: '-95px',
                    border: 'none',
                    color: 'white'
                }
            }
        }
    }
})

export default HomeMembershipSeccionStyle
